import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Button from "react-bootstrap/Button";
import { Container, Row, Col} from "react-bootstrap";
import Form from "react-bootstrap/Form";
import "./App.css";

class App extends Component {
  render() {
    return (
      <Container fluid className="main">
        <Row>
          <Col md={6} className="fill">
            <input type="text" placeholder="Enter Your Name"></input>
            <input type="text" placeholder="Enter Your Number"></input>
            <input type="text" placeholder="Enter Your Address"></input>
            <input type="date" placeholder="Enter" id="date"></input>
            <Form.Check type="radio" id="male" aria-label="radio 1" name="gender"/>
            <label for="male">Male</label>
            <Form.Check type="radio" id="female" aria-label="radio 1" name="gender"/>
            <label for="female">Female</label>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default App;
